Steve &quot;Luke&quot; Lukather (born October 21, 1957, San Fernando Valley, California) is an American Grammy Award-winning guitarist, singer, songwriter, arranger, and record producer best known for his work with the rock band Toto.

Genres Hard rock, pop rock, progressive rock, jazz fusion 

Albums
1989 Lukather @320k
1994 Candyman @320k
1997 Luke @320k
2003 Santamental @256k
2008 Ever Changing Times @320k
